import React from 'react';

import './banner.styles.scss';

const Banner = () => (

  <div className='banner'>
  <img
    className='image'
    src='https://www.dcsr.org/wp-content/uploads/2018/08/DCSkyline.jpg'
    alt='DC'
  />
  </div>

);

export default Banner;
